The title of this book roughly translates as &quot;A Catholic Communion Sermon, in which the question is discussed, whether it is true, that among the Catholics the laity only [raiche] a half-sacrament.&quot;  I'm guessing from the context that &quot;raiche&quot; is some regional or obsolete word meaning &quot;receive.&quot;  

The author if the book is:
&quot;Dem hochwirdigen Fursten und herrn / herrn Marquado erwehlten un bestettigten zu Bischouen zu Augspurg&quot;
Some of the above words appear to be older versions of erwählte and bestätigt, thus:
&quot;The Reverend Prince-Bishop and Lord / Lord Marquado chosen and confirmed to be Bishop of Augsburg&quot;

The author in question, then, is the Bishop of Augsberg in 1575, Marquard von Berg (1528-1591), who was elected Prince-Bishop of Augsberg on 26 July 1575, was confirmed in that appointment by the Pope on 24 September 1575, and served in that position until his death in 1591.  He was a layman at the time of his election in 1575, and was ordained a priest in that year and then formally consecrated bishop in 1576.  His position prior to his election was Provost of Bamberg Cathedral.

With this background, a fair guess is that this book served the role of providing an introduction of Marquard to his new diocese, since it was printed in 1575, obviously after his election and papal confirmation (which is why he is described as &quot;chosen and confirmed&quot;), but before he fully took up his new duties.  That would explain why a sermon from a new bishop for Augsberg was printed in Bamberg.  

It is instructive to know that Augsberg at this time was a cockpit of Catholic-Lutheran conflict, so the question of receiving communion in the Catholic manner under one form (bread) vs. the Lutheran manner of two forms (bread and wine) -- and thus whether Catholics were receiving a &quot;half-sacrament&quot; --  would be a live controversy.

So, if the coat of arms belongs to anyone, I think it would belong to Marquard of Berg.  He can be found in the VIAF under the German form of his name (Markwart) at <a href="http://viaf.org/viaf/59895798/" rel="nofollow">viaf.org/viaf/59895798/</a>.

