Figure of an old tree bound to a young sapling, giving it support, with the inscription, &quot;Restiamo fedeli e soccorrevoli l'uno all'altro fino'alla fine dei nostri giorni&quot;
Enrico Barfucci

&quot;We remain faithful and helping to each other until the end of our days.&quot;

This is the bookplate of Enrico Barfucci, who was born in Florence on 3 April 1889 and who died there in 1966.  A writer, editor, and journalist, he originated the idea of an international book fair on Florence, which was held from 1922-1932, and later served as the President of the Florentine Union (1951-1964) and as the creator and director of the &quot;Renaissance of the Book&quot; publishing house.  

The above information is drawn from a biographical sketch of him written in Italian: <a href="http://siusa.archivi.beniculturali.it/cgi-bin/pagina.pl?RicLin=en&amp;TipoPag=prodpersona&amp;RicDimF=2&amp;Chiave=54217&amp;RicProgetto=personalita&amp;RicVM=indice&amp;RicSez=prodpersone&amp;RicTipoScheda=pp" rel="nofollow">siusa.archivi.beniculturali.it/cgi-bin/pagina.pl?RicLin=e...</a>

